import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import {Nav, NavDropdown, Bug} from 'react-bootstrap';


export class Navbar extends Component {
    render() {
      return (
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link><Link to="/" class='link'>Home</Link></Nav.Link>
              <Nav.Link><Link to="/journal" class='link'>Journal</Link></Nav.Link>
              <NavDropdown title="Selfcare" id="basic-nav-dropdown">
                <NavDropdown.Item><Link to="/mental" class='link'>Mental Selfcare</Link></NavDropdown.Item>
                <NavDropdown.Item><Link to="/physical" class='link'>Physical Selfcare</Link></NavDropdown.Item>
                <NavDropdown.Item><Link to="/practical" class='link'>Practical Selfcare</Link></NavDropdown.Item>
                <NavDropdown.Item><Link to="/social" class='link'>Social Selfcare</Link></NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form inline>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Navbar>
    );
    }
  }

  export default Navbar;
